import React from 'react';
import './styles.css';

const Home: React.FC = () => {
    return (
      <div className="home-container">
        <body className="b">  
          <p>
            <h1> <span> FT_TRANSCENDENCE </span> </h1>
          </p>
        </body>
        <div className="button-container">
        <button className="button-52" role="button">42_Login</button>
        <button className="button-52" role="button">Sign_In</button>
        <button className="button-52" role="button">Sign_Up</button>
        </div>
      </div>
    );
}

export default Home;
